import Select from './components/Read/readpage';
function App() {
  return (
    <>
      <div>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Main />} />
            <Route path="read" element={<Read />} />
          </Routes>
        </BrowserRouter>

      </div>
    </>
  );
}

export default App;
